def PRNG(R,mask):
    nextR = (R << 1) & 0xffffffff
    i = (R & mask) & 0xffffffff
    nextbit = 0

    while i != 0:
        nextbit ^= (i % 2)
        i = i//2
    nextR ^= nextbit
    return (nextR, nextbit)

